INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, "", 101001, "マホ", 80001, 0, 0, 3, 0, 1, 30);
