INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 0, "", 104401, "イリヤ", 80001, 1, 0, 3, 0, 1, 32);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 0, "", 104401, "イリヤ", 80001, 1, 0, 3, 0, 2, 33);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 0, "", 101701, "カオリ", 80001, 2, 0, 3, 0, 1, 34);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これからも、どうぞよろしく\nお願いするさ～！", 0, "", 101701, "カオリ", 80001, 2, 0, 3, 0, 2, 35);
