INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 0, "", 102501, "スズメ", 80001, 1, 0, 4, 0, 2, 39);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("振り返れば、今までいろんなことが\nあったにゃあ…", 0, "", 104601, "タマキ", 80001, 0, 0, 5, 0, 1, 40);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, "", 104601, "タマキ", 80001, 0, 0, 5, 0, 2, 41);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 0, "", 104801, "ミフユ", 80001, 1, 0, 5, 0, 1, 42);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 0, "", 104801, "ミフユ", 80001, 1, 0, 5, 0, 2, 43);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あなたさまと出会ってもう1年…", 0, "", 103201, "アキノ", 80001, 0, 0, 6, 0, 1, 44);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, "", 103201, "アキノ", 80001, 0, 0, 6, 0, 2, 45);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 0, "", 103401, "ユカリ", 80001, 1, 0, 6, 0, 1, 46);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 0, "", 103401, "ユカリ", 80001, 1, 0, 6, 0, 2, 47);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, "", 107101, "クリスティーナ", 80001, 0, 0, 7, 0, 1, 48);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ともかくこれからも\n愉しませてくれよ☆", 0, "", 107101, "クリスティーナ", 80001, 0, 0, 7, 0, 2, 49);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 0, "", 104701, "ジュン", 80001, 1, 0, 7, 0, 1, 50);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("見えないから分からないって？\nそれもそうだな…", 0, "", 104701, "ジュン", 80001, 1, 0, 7, 0, 2, 51);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, "", 103701, "トモ", 80001, 0, 0, 8, 0, 1, 52);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これからもよろしくね！", 0, "", 103701, "トモ", 80001, 0, 0, 8, 0, 2, 53);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 0, "", 100501, "マツリ", 80001, 1, 0, 8, 0, 1, 54);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 0, "", 100501, "マツリ", 80001, 1, 0, 8, 0, 2, 55);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("オマエと会って1年なの！\n全然成仏もできなかったし、", 0, "", 100701, "ミヤコ", 80001, 0, 0, 9, 0, 1, 56);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, "", 100701, "ミヤコ", 80001, 0, 0, 9, 0, 2, 57);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 0, "", 103101, "シノブ", 80001, 1, 0, 9, 0, 1, 58);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 0, "", 103101, "シノブ", 80001, 1, 0, 9, 0, 2, 59);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, "", 100901, "アンナ", 80001, 0, 0, 10, 0, 1, 60);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, "", 100901, "アンナ", 80001, 0, 0, 10, 0, 2, 61);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("君と出会ってもう1年だって！\n早いねー！", 0, "", 101301, "ナナカ", 80001, 1, 0, 10, 0, 1, 62);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 0, "", 101301, "ナナカ", 80001, 1, 0, 10, 0, 2, 63);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, "", 105101, "ミツキ", 80001, 0, 0, 11, 0, 1, 64);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これからも、いろんなところを\n調べさせてね？", 0, "", 105101, "ミツキ", 80001, 0, 0, 11, 0, 2, 65);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("お前さんと出会ってもう1年か\n助太刀するつもりが", 0, "", 105601, "ルカ", 80001, 1, 0, 11, 0, 1, 66);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 0, "", 105601, "ルカ", 80001, 1, 0, 11, 0, 2, 67);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("早いものですわね、あなた様と\nお会いして、もう1年…", 0, "", 102701, "エリコ", 80001, 2, 0, 11, 0, 1, 68);
