INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, "", 102301, "アヤネ", 80001, 0, 0, 12, 0, 1, 70);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, "", 102301, "アヤネ", 80001, 0, 0, 12, 0, 2, 71);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 0, "", 104201, "チカ", 80001, 1, 0, 12, 0, 1, 72);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("私のことを見守ってください\nできることなら、ずっと…", 0, "", 104201, "チカ", 80001, 1, 0, 12, 0, 2, 73);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 0, "", 102101, "クルミ", 80001, 2, 0, 12, 0, 1, 74);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("で、でもこれからもずっと…\n一緒にいたいなぁ…", 0, "", 102101, "クルミ", 80001, 2, 0, 12, 0, 2, 75);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, "", 104901, "シズル", 80001, 0, 0, 13, 0, 1, 76);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, "", 104901, "シズル", 80001, 0, 0, 13, 0, 2, 77);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 0, "", 101101, "リノ", 80001, 1, 0, 13, 0, 1, 78);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 0, "", 101101, "リノ", 80001, 1, 0, 13, 0, 2, 79);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, "", 100201, "ユイ", 80001, 0, 0, 14, 0, 1, 80);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, "", 100201, "ユイ", 80001, 0, 0, 14, 0, 2, 81);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("騎士くんと出会って、まだ1年しか\nたってないんだ！？", 0, "", 100101, "ヒヨリ", 80001, 1, 0, 14, 0, 1, 82);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 0, "", 100101, "ヒヨリ", 80001, 1, 0, 14, 0, 2, 83);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 0, "", 100301, "レイ", 80001, 2, 0, 14, 0, 1, 84);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キミに背中を預けられる日が、\n早くきますように", 0, "", 100301, "レイ", 80001, 2, 0, 14, 0, 2, 85);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, "", 105801, "ペコリーヌ", 80001, 0, 0, 15, 0, 1, 86);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これからもずっと、覚えていて\nくださいね！", 0, "", 105801, "ペコリーヌ", 80001, 0, 0, 15, 0, 2, 87);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 0, "", 105901, "コッコロ", 80001, 1, 0, 15, 0, 1, 88);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 0, "", 105901, "コッコロ", 80001, 1, 0, 15, 0, 2, 89);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 0, "", 106001, "キャル", 80001, 2, 0, 15, 0, 1, 90);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 0, "", 106001, "キャル", 80001, 2, 0, 15, 0, 2, 91);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, "", 112101, "スズメ", 60001, 1, 1, 0, 0, 1, 92);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, "", 0, "", 60001, 2, 1, 0, 0, 0, 93);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, "", 60001, 2, 1, 0, 0, 0, 94);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, "", 0, "", 60001, 2, 1, 0, 0, 0, 95);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, "", 0, "", 60001, 2, 1, 0, 0, 0, 96);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 1, "", 0, "", 60001, 2, 2, 0, 0, 0, 97);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, "", 0, "", 60001, 2, 1, 0, 0, 0, 98);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, "", 0, "", 60001, 2, 1, 0, 0, 0, 99);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, "", 0, "", 60001, 2, 1, 0, 0, 0, 100);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, "", 0, "", 60001, 2, 1, 0, 0, 0, 101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, "", 0, "", 60001, 2, 2, 0, 0, 0, 102);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 3, "", 0, "", 60001, 2, 1, 0, 0, 0, 103);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 3, "", 0, "", 60001, 2, 1, 0, 0, 0, 104);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, "", 0, "", 60001, 2, 1, 0, 0, 0, 105);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, "", 0, "", 60001, 2, 1, 0, 0, 0, 106);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 3, "", 0, "", 60001, 2, 1, 0, 0, 0, 107);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 3, "", 0, "", 60001, 2, 1, 0, 0, 0, 108);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 3, "", 0, "", 60001, 2, 2, 0, 0, 0, 109);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 4, "", 0, "", 60001, 2, 1, 0, 0, 0, 110);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 4, "", 0, "", 60001, 2, 1, 0, 0, 0, 111);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 4, "", 0, "", 60001, 2, 1, 0, 0, 0, 112);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 4, "", 0, "", 60001, 2, 1, 0, 0, 0, 113);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 4, "", 0, "", 60001, 2, 1, 0, 0, 0, 114);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 4, "", 0, "", 60001, 2, 1, 0, 0, 0, 115);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 4, "", 0, "", 60001, 2, 2, 0, 0, 0, 116);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, "", 112101, "スズメ", 60001, 3, 0, 0, 0, 2, 117);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 0, "", 112101, "スズメ", 60001, 3, 0, 7, 0, 3, 118);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ヒューヒュー♪\nドンドンパフパフー♪", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 1, 0, 1, 119);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ひゅーひゅー\nどんどんぱふぱふー\nでございます", 0, "", 105901, "コッコロ", 80003, 1, 0, 1, 0, 1, 120);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 0, "", 105901, "コッコロ", 80003, 1, 0, 1, 0, 2, 121);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("え？　ちょっと\nいきなりなにっ？", 0, "", 106001, "キャル", 80003, 2, 0, 1, 0, 1, 122);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 0, "", 106001, "キャル", 80003, 2, 0, 1, 0, 2, 123);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 1, 0, 2, 124);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 1, 0, 3, 125);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ですからその日に向けて\n今から気分を盛り上げているのです", 0, "", 105901, "コッコロ", 80003, 1, 0, 1, 0, 3, 126);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 0, "", 106001, "キャル", 80003, 2, 0, 1, 0, 3, 127);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 0, "", 105901, "コッコロ", 80003, 1, 0, 1, 0, 4, 128);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 1, 0, 4, 129);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 0, "", 106001, "キャル", 80003, 2, 0, 1, 0, 4, 130);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 0, "", 105901, "コッコロ", 80003, 1, 0, 1, 0, 5, 131);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, "", 106001, "キャル", 80003, 0, 0, 2, 0, 5, 132);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 0, "", 190801, "カリン", 80003, 1, 0, 2, 0, 1, 133);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("げっ…カリンじゃない\nなんでもないわよ！", 0, "", 106001, "キャル", 80003, 0, 0, 2, 0, 6, 134);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 0, "", 190801, "カリン", 80003, 1, 0, 2, 0, 2, 135);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, "", 106001, "キャル", 80003, 0, 0, 2, 0, 7, 136);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 0, "", 190801, "カリン", 80003, 1, 0, 2, 0, 3, 137);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, "", 106001, "キャル", 80003, 0, 0, 2, 0, 8, 138);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, "", 106001, "キャル", 80003, 0, 0, 2, 0, 9, 139);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 0, "", 190801, "カリン", 80003, 1, 0, 2, 0, 4, 140);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, "", 106001, "キャル", 80003, 0, 0, 2, 0, 10, 141);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 0, "", 190801, "カリン", 80003, 1, 0, 2, 0, 5, 142);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, "", 106001, "キャル", 80003, 0, 0, 2, 0, 11, 143);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, "", 105901, "コッコロ", 80003, 0, 0, 3, 0, 6, 144);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 0, "", 105801, "ペコリーヌ", 80003, 1, 0, 3, 0, 5, 145);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, "", 105901, "コッコロ", 80003, 0, 0, 3, 0, 7, 146);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, "", 105901, "コッコロ", 80003, 0, 0, 3, 0, 8, 147);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 0, "", 105801, "ペコリーヌ", 80003, 1, 0, 3, 0, 6, 148);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 0, "", 105801, "ペコリーヌ", 80003, 1, 0, 3, 0, 7, 149);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あとは、牧場に素敵な温泉が\n出来たとか…", 0, "", 105901, "コッコロ", 80003, 0, 0, 3, 0, 9, 150);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 0, "", 105801, "ペコリーヌ", 80003, 1, 0, 3, 0, 8, 151);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, "", 105901, "コッコロ", 80003, 0, 0, 3, 0, 10, 152);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えへへ、ありがとうございます\nコッコロちゃん！", 0, "", 105801, "ペコリーヌ", 80003, 1, 0, 3, 0, 9, 153);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, "", 105901, "コッコロ", 80003, 0, 0, 3, 0, 11, 154);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 0, "", 105801, "ペコリーヌ", 80003, 1, 0, 3, 0, 10, 155);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 4, 0, 11, 156);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 0, "", 106001, "キャル", 80003, 1, 0, 4, 0, 12, 157);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 4, 0, 12, 158);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 0, "", 106001, "キャル", 80003, 1, 0, 4, 0, 13, 159);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 4, 0, 13, 160);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…積極的？\nなんの話よ？", 0, "", 106001, "キャル", 80003, 1, 0, 4, 0, 14, 161);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 4, 0, 14, 162);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ムーサの町で\nきゃるきゃる～ん☆　って！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 4, 0, 15, 163);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 0, "", 106001, "キャル", 80003, 1, 0, 4, 0, 15, 164);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 4, 0, 16, 165);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 0, "", 106001, "キャル", 80003, 1, 0, 4, 0, 16, 166);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 0, "", 106001, "キャル", 80003, 1, 0, 4, 0, 17, 167);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, "", 106001, "キャル", 80003, 0, 0, 5, 0, 18, 168);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 0, "", 105901, "コッコロ", 80003, 1, 0, 5, 0, 12, 169);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, "", 106001, "キャル", 80003, 0, 0, 5, 0, 19, 170);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 0, "", 105901, "コッコロ", 80003, 1, 0, 5, 0, 13, 171);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, "", 106001, "キャル", 80003, 0, 0, 5, 0, 20, 172);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 0, "", 105901, "コッコロ", 80003, 1, 0, 5, 0, 14, 173);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, "", 106001, "キャル", 80003, 0, 0, 5, 0, 21, 174);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 0, "", 105901, "コッコロ", 80003, 1, 0, 5, 0, 15, 175);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("かくし芸？", 0, "", 106001, "キャル", 80003, 0, 0, 5, 0, 22, 176);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 0, "", 105901, "コッコロ", 80003, 1, 0, 5, 0, 16, 177);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, "", 106001, "キャル", 80003, 0, 0, 5, 0, 23, 178);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 6, 0, 17, 179);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 0, "", 106001, "キャル", 80003, 2, 0, 6, 0, 24, 180);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 0, "", 105901, "コッコロ", 80003, 1, 0, 6, 0, 17, 181);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 6, 0, 18, 182);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 0, "", 106001, "キャル", 80003, 2, 0, 6, 0, 25, 183);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 0, "", 105901, "コッコロ", 80003, 1, 0, 6, 0, 18, 184);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 0, "", 106001, "キャル", 80003, 2, 0, 6, 0, 26, 185);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 0, "", 106001, "キャル", 80003, 2, 0, 6, 0, 27, 186);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 0, "", 106001, "キャル", 80003, 2, 0, 6, 0, 28, 187);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 6, 0, 19, 188);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 0, "", 105901, "コッコロ", 80003, 1, 0, 6, 0, 19, 189);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 0, "", 106001, "キャル", 80003, 2, 0, 6, 0, 29, 190);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, "", 106001, "キャル", 80003, 0, 0, 7, 0, 30, 191);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, "", 106001, "キャル", 80003, 0, 0, 7, 0, 31, 192);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, "", 106001, "キャル", 80003, 0, 0, 7, 0, 32, 193);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あー\nあー\n…声、これで大丈夫かしら？", 0, "", 106001, "キャル", 80003, 0, 0, 7, 0, 33, 194);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, "", 106001, "キャル", 80003, 0, 0, 7, 0, 34, 195);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("オイッスー☆", 0, "", 106001, "キャル", 80003, 0, 0, 7, 0, 35, 196);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, "", 106001, "キャル", 80003, 0, 0, 7, 0, 36, 197);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, "", 106001, "キャル", 80003, 0, 0, 7, 0, 37, 198);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, "", 106001, "キャル", 80003, 0, 0, 7, 0, 38, 199);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, "", 105901, "コッコロ", 80003, 0, 0, 8, 0, 20, 200);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, "", 105901, "コッコロ", 80003, 0, 0, 8, 0, 21, 201);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, "", 105901, "コッコロ", 80003, 0, 0, 8, 0, 22, 202);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, "", 105901, "コッコロ", 80003, 0, 0, 8, 0, 23, 203);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, "", 105901, "コッコロ", 80003, 0, 0, 8, 0, 24, 204);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("オイッスー☆", 0, "", 105901, "コッコロ", 80003, 0, 0, 8, 0, 25, 205);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, "", 105901, "コッコロ", 80003, 0, 0, 8, 0, 26, 206);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, "", 105901, "コッコロ", 80003, 0, 0, 8, 0, 27, 207);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, "", 105901, "コッコロ", 80003, 0, 0, 8, 0, 28, 208);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("オイッスー☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 20, 209);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 21, 210);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あと６日で2.5周年ですか…", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 22, 211);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 23, 212);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 24, 213);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("オイッスー☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 25, 214);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 26, 215);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 27, 216);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 28, 217);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 29, 218);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 9, 0, 30, 219);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 10, 0, 31, 220);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 0, "", 105901, "コッコロ", 80003, 1, 0, 10, 0, 29, 221);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 10, 0, 32, 222);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…………", 0, "", 106001, "キャル", 80003, 2, 0, 10, 0, 39, 223);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 0, "", 105901, "コッコロ", 80003, 1, 0, 10, 0, 30, 224);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 0, "", 106001, "キャル", 80003, 2, 0, 10, 0, 40, 225);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 10, 0, 33, 226);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 0, "", 106001, "キャル", 80003, 2, 0, 10, 0, 41, 227);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 10, 0, 34, 228);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 10, 0, 35, 229);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 0, "", 106001, "キャル", 80003, 2, 0, 10, 0, 42, 230);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 0, "", 105901, "コッコロ", 80003, 1, 0, 10, 0, 31, 231);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 0, "", 106001, "キャル", 80003, 2, 0, 10, 0, 43, 232);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 10, 0, 36, 233);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 6, 234);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 7, 235);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 8, 236);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 9, 237);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 10, 238);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("次にコッコロさんですが\nこちらは発声練習をしています", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 11, 239);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 12, 240);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 13, 241);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あれ？\nもしかして緊張で気を失って…？", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 14, 242);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 15, 243);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 16, 244);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それでは\nまた明日お会いしましょう♪", 0, "", 190801, "カリン", 80003, 0, 0, 11, 0, 17, 245);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, "", 106001, "キャル", 80003, 0, 0, 12, 0, 44, 246);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 0, "", 105801, "ペコリーヌ", 80003, 2, 0, 12, 0, 37, 247);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 0, "", 105901, "コッコロ", 80003, 1, 0, 12, 0, 32, 248);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, "", 106001, "キャル", 80003, 0, 0, 12, 0, 45, 249);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ひどいですよぉキャルちゃ～ん！", 0, "", 105801, "ペコリーヌ", 80003, 2, 0, 12, 0, 38, 250);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 0, "", 105901, "コッコロ", 80003, 1, 0, 12, 0, 33, 251);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 0, "", 105801, "ペコリーヌ", 80003, 2, 0, 12, 0, 39, 252);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, "", 106001, "キャル", 80003, 0, 0, 12, 0, 46, 253);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 0, "", 105901, "コッコロ", 80003, 1, 0, 12, 0, 34, 254);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 0, "", 105801, "ペコリーヌ", 80003, 2, 0, 12, 0, 40, 255);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 13, 0, 41, 256);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 0, "", 106001, "キャル", 80003, 2, 0, 13, 0, 47, 257);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("忘れてきちゃいました☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 13, 0, 42, 258);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 0, "", 106001, "キャル", 80003, 2, 0, 13, 0, 48, 259);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 0, "", 105901, "コッコロ", 80003, 1, 0, 13, 0, 35, 260);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 0, "", 106001, "キャル", 80003, 2, 0, 13, 0, 49, 261);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 13, 0, 43, 262);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 0, "", 106001, "キャル", 80003, 2, 0, 13, 0, 50, 263);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 0, "", 105901, "コッコロ", 80003, 1, 0, 13, 0, 36, 264);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 0, "", 106001, "キャル", 80003, 2, 0, 13, 0, 51, 265);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 0, "", 105901, "コッコロ", 80003, 1, 0, 13, 0, 37, 266);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 0, "", 106001, "キャル", 80003, 2, 0, 13, 0, 52, 267);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 13, 0, 44, 268);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 0, "", 105901, "コッコロ", 80003, 1, 0, 13, 0, 38, 269);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 13, 0, 45, 270);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 0, "", 106001, "キャル", 80003, 2, 0, 13, 0, 53, 271);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 13, 0, 46, 272);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("こんにちは\n【ギルド管理協会】のカリンです", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 18, 273);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("昨日の生放送は\nいかがだったでしょうか？", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 19, 274);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 20, 275);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 21, 276);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 22, 277);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 23, 278);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 24, 279);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 25, 280);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 26, 281);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, "", 190801, "カリン", 80003, 0, 0, 14, 0, 27, 282);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("準備はいいですかっ？\n…いっきますよー！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 15, 0, 47, 283);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("祝！", 0, "", 106001, "キャル", 80003, 2, 0, 15, 0, 54, 284);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("2.5周年！", 0, "", 105901, "コッコロ", 80003, 1, 0, 15, 0, 39, 285);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("おめでとうございま～す☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 15, 0, 48, 286);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 0, "", 106001, "キャル", 80003, 2, 0, 15, 0, 55, 287);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 0, "", 105901, "コッコロ", 80003, 1, 0, 15, 0, 40, 288);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 15, 0, 49, 289);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 0, "", 106001, "キャル", 80003, 2, 0, 15, 0, 56, 290);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 0, "", 105901, "コッコロ", 80003, 1, 0, 15, 0, 41, 291);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 0, "", 106001, "キャル", 80003, 2, 0, 15, 0, 57, 292);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 15, 0, 50, 293);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 0, "", 106001, "キャル", 80003, 2, 0, 15, 0, 58, 294);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("記念日だから\n平気平気♪\nやばいですね☆", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 15, 0, 51, 295);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("意味分かんないわよ！", 0, "", 106001, "キャル", 80003, 2, 0, 15, 0, 59, 296);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 0, "", 105901, "コッコロ", 80003, 1, 0, 15, 0, 42, 297);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 0, "", 105901, "コッコロ", 80003, 1, 0, 15, 0, 43, 298);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 15, 0, 52, 299);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 0, "", 106001, "キャル", 80003, 2, 0, 15, 0, 60, 300);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 0, "", 105901, "コッコロ", 80003, 1, 0, 15, 0, 44, 301);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, "", 105801, "ペコリーヌ", 80003, 0, 0, 15, 0, 53, 302);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("2.5周年\nありがとうございます！", 0, "105901,45,106001,61", 105801, "ペコリーヌ・コッコロ・キャル", 80003, 0, 0, 15, 1, 54, 303);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, "", 190804, "カリン", 60002, 1, 1, 0, 0, 1, 304);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, "", 0, "", 60002, 2, 1, 0, 0, 0, 305);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, "", 60002, 2, 1, 0, 0, 0, 306);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, "", 0, "", 60002, 2, 1, 0, 0, 0, 307);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, "", 0, "", 60002, 2, 1, 0, 0, 0, 308);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 1, "", 0, "", 60002, 2, 2, 0, 0, 0, 309);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, "", 0, "", 60002, 2, 1, 0, 0, 0, 310);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, "", 0, "", 60002, 2, 1, 0, 0, 0, 311);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, "", 0, "", 60002, 2, 1, 0, 0, 0, 312);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, "", 0, "", 60002, 2, 1, 0, 0, 0, 313);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, "", 0, "", 60002, 2, 2, 0, 0, 0, 314);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 3, "", 0, "", 60002, 2, 1, 0, 0, 0, 315);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 3, "", 0, "", 60002, 2, 1, 0, 0, 0, 316);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, "", 0, "", 60002, 2, 1, 0, 0, 0, 317);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 3, "", 0, "", 60002, 2, 1, 0, 0, 0, 318);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 3, "", 0, "", 60002, 2, 1, 0, 0, 0, 319);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, "", 0, "", 60002, 2, 1, 0, 0, 0, 320);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 3, "", 0, "", 60002, 2, 2, 0, 0, 0, 321);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 4, "", 0, "", 60002, 2, 1, 0, 0, 0, 322);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 4, "", 0, "", 60002, 2, 1, 0, 0, 0, 323);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 4, "", 0, "", 60002, 2, 1, 0, 0, 0, 324);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 4, "", 0, "", 60002, 2, 1, 0, 0, 0, 325);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 4, "", 0, "", 60002, 2, 1, 0, 0, 0, 326);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 4, "", 0, "", 60002, 2, 1, 0, 0, 0, 327);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 4, "", 0, "", 60002, 2, 2, 0, 0, 0, 328);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 190804, "カリン", 60002, 3, 0, 0, 0, 2, 329);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, "", 190804, "カリン", 60002, 3, 0, 7, 0, 3, 330);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ささ、シェフィさまはこちらへ…", 0, "", 105901, "コッコロ", 80005, 4, 0, 1, 0, 1, 331);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("コッコロさん、どこへ行くの…？\n…え？", 0, "", 106401, "シェフィ", 80005, 0, 0, 1, 0, 1, 332);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 1, 0, 1, 333);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 0, "", 105901, "コッコロ", 80005, 4, 0, 1, 0, 2, 334);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ええと…\n二人とも何をしているの？", 0, "", 106401, "シェフィ", 80005, 0, 0, 1, 0, 2, 335);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 0, "", 106001, "キャル", 80005, 1, 0, 1, 0, 1, 336);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あの日…？", 0, "", 106401, "シェフィ", 80005, 0, 0, 1, 0, 3, 337);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 1, 0, 2, 338);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("『プリンセスコネクト！\nRe:Dive』3.5周年！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 1, 0, 3, 339);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("やばいですね☆", 0, "", 190801, "カリン", 80005, 2, 0, 1, 0, 1, 340);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("って、なにしれっと\n参加してんのよカリン！", 0, "", 106001, "キャル", 80005, 1, 0, 1, 0, 2, 341);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 0, "", 190801, "カリン", 80005, 2, 0, 1, 0, 2, 342);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 0, "", 190801, "カリン", 80005, 2, 0, 1, 0, 3, 343);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 1, 0, 4, 344);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えっ！？　ええとええと…！\nあ、あと14日…！", 0, "", 106401, "シェフィ", 80005, 0, 0, 1, 0, 4, 345);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 2, 0, 5, 346);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 0, "", 105901, "コッコロ", 80005, 1, 0, 2, 0, 3, 347);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 0, "", 105901, "コッコロ", 80005, 1, 0, 2, 0, 4, 348);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 2, 0, 6, 349);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("さすがでございます\nペコリーヌさま", 0, "", 105901, "コッコロ", 80005, 1, 0, 2, 0, 5, 350);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, "", 106001, "キャル", 80005, 0, 0, 2, 0, 3, 351);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("しゃなり、しゃなり…\nふふ、案外できるものね", 0, "", 106401, "シェフィ", 80005, 2, 0, 2, 0, 5, 352);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 2, 0, 7, 353);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("さ、次はキャルさまの\n番でございますよ", 0, "", 105901, "コッコロ", 80005, 1, 0, 2, 0, 6, 354);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, "", 106001, "キャル", 80005, 0, 0, 2, 0, 4, 355);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 0, "", 106401, "シェフィ", 80005, 2, 0, 2, 0, 6, 356);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, "", 106001, "キャル", 80005, 0, 0, 2, 0, 5, 357);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, "", 106001, "キャル", 80005, 0, 0, 2, 0, 6, 358);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 0, "", 105901, "コッコロ", 80005, 1, 0, 2, 0, 7, 359);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, "", 106001, "キャル", 80005, 0, 0, 2, 0, 7, 360);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 0, "", 105901, "コッコロ", 80005, 1, 0, 3, 0, 8, 361);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 3, 0, 8, 362);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 0, "", 105901, "コッコロ", 80005, 1, 0, 3, 0, 9, 363);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("聖学祭…って、なにかしら？", 0, "", 106401, "シェフィ", 80005, 2, 0, 3, 0, 7, 364);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 0, "", 105901, "コッコロ", 80005, 1, 0, 3, 0, 10, 365);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, "", 106001, "キャル", 80005, 0, 0, 3, 0, 8, 366);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, "", 106001, "キャル", 80005, 0, 0, 3, 0, 9, 367);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 3, 0, 9, 368);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("いや、そのまんますぎでしょ…", 0, "", 106001, "キャル", 80005, 0, 0, 3, 0, 10, 369);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 0, "", 106401, "シェフィ", 80005, 2, 0, 3, 0, 8, 370);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 3, 0, 10, 371);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えっ？　ええ…\nぎゅーっ…？", 0, "", 106401, "シェフィ", 80005, 2, 0, 3, 0, 9, 372);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, "", 106001, "キャル", 80005, 0, 0, 4, 0, 11, 373);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 0, "", 106401, "シェフィ", 80005, 2, 0, 4, 0, 10, 374);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, "", 106001, "キャル", 80005, 0, 0, 4, 0, 12, 375);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 0, "", 105901, "コッコロ", 80005, 1, 0, 4, 0, 11, 376);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, "", 106001, "キャル", 80005, 0, 0, 4, 0, 13, 377);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 4, 0, 11, 378);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, "", 106001, "キャル", 80005, 0, 0, 4, 0, 14, 379);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, "", 106001, "キャル", 80005, 0, 0, 4, 0, 15, 380);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 0, "", 106401, "シェフィ", 80005, 2, 0, 4, 0, 11, 381);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 4, 0, 12, 382);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 0, "", 105901, "コッコロ", 80005, 1, 0, 4, 0, 12, 383);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, "", 106001, "キャル", 80005, 0, 0, 4, 0, 16, 384);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 0, "", 106401, "シェフィ", 80005, 2, 0, 4, 0, 12, 385);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 5, 0, 13, 386);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 5, 0, 14, 387);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 5, 0, 15, 388);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, "", 106001, "キャル", 80005, 0, 0, 5, 0, 17, 389);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, "", 106001, "キャル", 80005, 0, 0, 5, 0, 18, 390);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 0, "", 106401, "シェフィ", 80005, 2, 0, 5, 0, 13, 391);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 0, "", 105901, "コッコロ", 80005, 1, 0, 5, 0, 13, 392);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 5, 0, 16, 393);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, "", 106001, "キャル", 80005, 0, 0, 5, 0, 19, 394);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 5, 0, 17, 395);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 5, 0, 18, 396);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 5, 0, 19, 397);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 0, "", 190801, "カリン", 80005, 2, 0, 6, 0, 4, 398);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 0, "", 190801, "カリン", 80005, 2, 0, 6, 0, 5, 399);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…えっ！？", 0, "", 106001, "キャル", 80005, 1, 0, 6, 0, 20, 400);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 6, 0, 20, 401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, "", 106401, "シェフィ", 80005, 0, 0, 6, 0, 14, 402);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 0, "", 105901, "コッコロ", 80005, 4, 0, 6, 0, 14, 403);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, "", 106401, "シェフィ", 80005, 0, 0, 6, 0, 15, 404);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 0, "", 106001, "キャル", 80005, 1, 0, 6, 0, 21, 405);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 6, 0, 21, 406);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ぶっ殺すぞ！？", 0, "", 106001, "キャル", 80005, 1, 0, 6, 0, 22, 407);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 0, "", 190801, "カリン", 80005, 2, 0, 6, 0, 6, 408);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 0, "", 105901, "コッコロ", 80005, 1, 0, 7, 0, 15, 409);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, "", 106001, "キャル", 80005, 0, 0, 7, 0, 23, 410);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 0, "", 106401, "シェフィ", 80005, 2, 0, 7, 0, 16, 411);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 7, 0, 22, 412);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, "", 106001, "キャル", 80005, 0, 0, 7, 0, 24, 413);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 0, "", 106401, "シェフィ", 80005, 2, 0, 7, 0, 17, 414);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 0, "", 105901, "コッコロ", 80005, 1, 0, 7, 0, 16, 415);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 0, "", 106401, "シェフィ", 80005, 2, 0, 7, 0, 18, 416);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("もちろんでございます\n仲良くお勉強いたしましょう", 0, "", 105901, "コッコロ", 80005, 1, 0, 7, 0, 17, 417);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("しれっと教育ママが\n生まれてる…？", 0, "", 106001, "キャル", 80005, 0, 0, 7, 0, 25, 418);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 7, 0, 23, 419);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("え～～～～！？", 0, "", 106001, "キャル", 80005, 0, 0, 7, 0, 26, 420);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, "", 106001, "キャル", 80005, 0, 0, 8, 0, 27, 421);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…\nねぇコッコロさん\nキャル、どうしちゃったの？", 0, "", 106401, "シェフィ", 80005, 2, 0, 8, 0, 19, 422);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 0, "", 105901, "コッコロ", 80005, 1, 0, 8, 0, 18, 423);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 8, 0, 24, 424);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 0, "", 106401, "シェフィ", 80005, 2, 0, 8, 0, 20, 425);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, "", 106001, "キャル", 80005, 0, 0, 8, 0, 28, 426);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 0, "", 105901, "コッコロ", 80005, 1, 0, 8, 0, 19, 427);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 0, "", 106401, "シェフィ", 80005, 2, 0, 8, 0, 21, 428);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, "", 106001, "キャル", 80005, 0, 0, 8, 0, 29, 429);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, "", 106001, "キャル", 80005, 0, 0, 8, 0, 30, 430);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 8, 0, 25, 431);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, "", 106001, "キャル", 80005, 0, 0, 8, 0, 31, 432);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, "", 106401, "シェフィ", 80005, 0, 0, 9, 0, 22, 433);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…えっ？\n生放送の意気込み！？\n突然なに！？", 0, "", 106401, "シェフィ", 80005, 0, 0, 9, 0, 23, 434);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, "", 106401, "シェフィ", 80005, 0, 0, 9, 0, 24, 435);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, "", 106401, "シェフィ", 80005, 0, 0, 9, 0, 25, 436);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, "", 106401, "シェフィ", 80005, 0, 0, 9, 0, 26, 437);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それから、それから…！\nぅ、ぅぅっ…！", 0, "", 106401, "シェフィ", 80005, 0, 0, 9, 0, 27, 438);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("―びえぇぇ～んっ！！！", 0, "", 106401, "シェフィ", 80005, 0, 0, 9, 0, 28, 439);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("どうされましたか、シェフィさま", 0, "", 105901, "コッコロ", 80005, 1, 0, 9, 0, 20, 440);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ううっ…ひっく…\nママッ…！", 0, "", 106401, "シェフィ", 80005, 0, 0, 9, 0, 29, 441);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 0, "", 105901, "コッコロ", 80005, 1, 0, 9, 0, 21, 442);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 0, "", 105901, "コッコロ", 80005, 1, 0, 9, 0, 22, 443);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, "", 106401, "シェフィ", 80005, 0, 0, 9, 0, 30, 444);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("主さま\n3.5周年まであと５日\nでございます", 0, "", 105901, "コッコロ", 80005, 0, 0, 10, 0, 23, 445);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ですがその前に\n生放送がありますね", 0, "", 105901, "コッコロ", 80005, 0, 0, 10, 0, 24, 446);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…生放送に向けた\n意気込みでございますか？", 0, "", 105901, "コッコロ", 80005, 0, 0, 10, 0, 25, 447);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, "", 105901, "コッコロ", 80005, 0, 0, 10, 0, 26, 448);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, "", 105901, "コッコロ", 80005, 0, 0, 10, 0, 27, 449);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, "", 105901, "コッコロ", 80005, 0, 0, 10, 0, 28, 450);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, "", 105901, "コッコロ", 80005, 0, 0, 10, 0, 29, 451);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, "", 105901, "コッコロ", 80005, 0, 0, 10, 0, 30, 452);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, "", 105901, "コッコロ", 80005, 0, 0, 10, 0, 31, 453);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと４日！\nやばいですね☆", 0, "", 105801, "ペコリーヌ", 80005, 0, 0, 11, 0, 26, 454);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 0, "", 106001, "キャル", 80005, 1, 0, 11, 0, 32, 455);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, "", 105801, "ペコリーヌ", 80005, 0, 0, 11, 0, 27, 456);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, "", 105801, "ペコリーヌ", 80005, 0, 0, 11, 0, 28, 457);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, "", 105801, "ペコリーヌ", 80005, 0, 0, 11, 0, 29, 458);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 0, "", 106001, "キャル", 80005, 1, 0, 11, 0, 33, 459);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, "", 105801, "ペコリーヌ", 80005, 0, 0, 11, 0, 30, 460);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, "", 105801, "ペコリーヌ", 80005, 0, 0, 11, 0, 31, 461);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, "", 105801, "ペコリーヌ", 80005, 0, 0, 11, 0, 32, 462);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("だからあたしはやるなんて一言も…", 0, "", 106001, "キャル", 80005, 1, 0, 11, 0, 34, 463);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("オイッスー☆", 0, "", 105801, "ペコリーヌ", 80005, 0, 0, 11, 0, 33, 464);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("聞きなさいっての！！", 0, "", 106001, "キャル", 80005, 1, 0, 11, 0, 35, 465);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと３日…\nそして生放送は、明日…", 0, "", 106401, "シェフィ", 80005, 2, 0, 12, 0, 31, 466);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 0, "", 106401, "シェフィ", 80005, 2, 0, 12, 0, 32, 467);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("おいっす！\n…こうじゃなかったわね\nええと確か…", 0, "", 106401, "シェフィ", 80005, 2, 0, 12, 0, 33, 468);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 0, "", 106401, "シェフィ", 80005, 2, 0, 12, 0, 34, 469);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 0, "", 106401, "シェフィ", 80005, 2, 0, 12, 0, 35, 470);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("やってますねシェフィちゃん！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 12, 0, 34, 471);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なによ、考えることは\nみんな同じってこと？", 0, "", 106001, "キャル", 80005, 0, 0, 12, 0, 36, 472);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 0, "", 105901, "コッコロ", 80005, 1, 0, 12, 0, 32, 473);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("みんな…もちろんよ！", 0, "", 106401, "シェフィ", 80005, 2, 0, 12, 0, 36, 474);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 12, 0, 35, 475);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 0, "", 190801, "カリン", 80005, 2, 0, 13, 0, 7, 476);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 0, "", 190801, "カリン", 80005, 2, 0, 13, 0, 8, 477);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 13, 0, 36, 478);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 0, "", 190801, "カリン", 80005, 2, 0, 13, 0, 9, 479);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 0, "", 105901, "コッコロ", 80005, 4, 0, 13, 0, 33, 480);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("さすが【美食殿】のママですね！\nそしてキャルさんは…", 0, "", 190801, "カリン", 80005, 2, 0, 13, 0, 10, 481);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("大丈夫…大丈夫…\nあたしは大丈夫…", 0, "", 106001, "キャル", 80005, 1, 0, 13, 0, 37, 482);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 0, "", 190801, "カリン", 80005, 2, 0, 13, 0, 11, 483);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あうー？", 0, "", 106401, "シェフィ", 80005, 0, 0, 13, 0, 37, 484);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("あ…", 0, "105901,34,106001,38,190801,12", 105801, "みんな", 80005, 4, 0, 13, 1, 37, 485);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 0, "", 106001, "キャル", 80005, 1, 0, 13, 0, 39, 486);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 0, "", 105901, "コッコロ", 80005, 4, 0, 13, 0, 35, 487);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 13, 0, 38, 488);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 0, "", 190801, "カリン", 80005, 2, 0, 13, 0, 13, 489);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 0, "", 106401, "シェフィ", 80005, 2, 0, 14, 0, 38, 490);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 14, 0, 39, 491);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, "", 106001, "キャル", 80005, 0, 0, 14, 0, 40, 492);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 0, "", 105901, "コッコロ", 80005, 1, 0, 14, 0, 36, 493);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 0, "", 106401, "シェフィ", 80005, 2, 0, 14, 0, 39, 494);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 14, 0, 40, 495);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 0, "", 105901, "コッコロ", 80005, 1, 0, 14, 0, 37, 496);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, "", 106001, "キャル", 80005, 0, 0, 14, 0, 41, 497);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("へ、へぇ…", 0, "", 106401, "シェフィ", 80005, 2, 0, 14, 0, 40, 498);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 14, 0, 41, 499);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 0, "", 106401, "シェフィ", 80005, 2, 0, 14, 0, 41, 500);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 0, "", 106401, "シェフィ", 80005, 2, 0, 14, 0, 42, 501);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 15, 0, 42, 502);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("祝！", 0, "", 106001, "キャル", 80005, 1, 0, 15, 0, 42, 503);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("3.5周年！", 0, "", 105901, "コッコロ", 80005, 4, 0, 15, 0, 38, 504);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("おめでとうございます！", 0, "", 106401, "シェフィ", 80005, 0, 0, 15, 0, 43, 505);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 0, "", 190801, "カリン", 80005, 2, 0, 15, 0, 14, 506);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 0, "", 190801, "カリン", 80005, 2, 0, 15, 0, 15, 507);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 15, 0, 43, 508);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 15, 0, 44, 509);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 0, "", 106001, "キャル", 80005, 1, 0, 15, 0, 43, 510);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 0, "", 106001, "キャル", 80005, 1, 0, 15, 0, 44, 511);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, "", 106401, "シェフィ", 80005, 0, 0, 15, 0, 44, 512);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, "", 106401, "シェフィ", 80005, 0, 0, 15, 0, 45, 513);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 0, "", 105901, "コッコロ", 80005, 4, 0, 15, 0, 39, 514);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 0, "", 105901, "コッコロ", 80005, 4, 0, 15, 0, 40, 515);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 0, "", 105901, "コッコロ", 80005, 4, 0, 15, 0, 41, 516);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 0, "", 105801, "ペコリーヌ", 80005, 3, 0, 15, 0, 45, 517);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("これからも\nよろしくおねがいします！", 0, "105901,42,106001,45,106401,46,190801,16", 105801, "みんな", 80005, 4, 0, 15, 1, 46, 518);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, "", 190804, "カリン", 60003, 1, 1, 0, 0, 1, 519);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, "", 0, "", 60003, 2, 1, 0, 0, 0, 520);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, "", 60003, 2, 1, 0, 0, 0, 521);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1, "", 0, "", 60003, 2, 1, 0, 0, 0, 522);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 1, "", 0, "", 60003, 2, 1, 0, 0, 0, 523);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 1, "", 0, "", 60003, 2, 2, 0, 0, 0, 524);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, "", 0, "", 60003, 2, 1, 0, 0, 0, 525);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, "", 0, "", 60003, 2, 1, 0, 0, 0, 526);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 2, "", 0, "", 60003, 2, 1, 0, 0, 0, 527);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 2, "", 0, "", 60003, 2, 1, 0, 0, 0, 528);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, "", 0, "", 60003, 2, 2, 0, 0, 0, 529);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 3, "", 0, "", 60003, 2, 1, 0, 0, 0, 530);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 3, "", 0, "", 60003, 2, 1, 0, 0, 0, 531);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, "", 0, "", 60003, 2, 1, 0, 0, 0, 532);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 3, "", 0, "", 60003, 2, 1, 0, 0, 0, 533);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 3, "", 0, "", 60003, 2, 1, 0, 0, 0, 534);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, "", 0, "", 60003, 2, 1, 0, 0, 0, 535);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 3, "", 0, "", 60003, 2, 2, 0, 0, 0, 536);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 4, "", 0, "", 60003, 2, 1, 0, 0, 0, 537);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 4, "", 0, "", 60003, 2, 1, 0, 0, 0, 538);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 4, "", 0, "", 60003, 2, 1, 0, 0, 0, 539);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES ("今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 4, "", 0, "", 60003, 2, 1, 0, 0, 0, 540);
